You MUST output a valid JSON object that conforms to the schema below.
Do NOT return the schema definition. Return only the JSON data instance matching the schema.
Make sure the JSON is complete and valid. Do not truncate the output.
Schema:
{
  "$defs": {
    "SerializedInformationBlock": {
      "description": "A single self-contained information block enriched with comprehensive context",
      "properties": {
        "subject_core_entity": {
          "description": "A primary focus of what this block is about. Usually located in a row header. If one row in the table doesn't make sense without neighboring rows, you can merge information from neighboring rows into one block",
          "title": "Subject Core Entity",
          "type": "string"
        },
        "information_block": {
          "description": "Detailed information about the chosen core subject from tables and additional texts. Information SHOULD include:\n1. All related header information\n2. All related units and their descriptions\n    2.1. If header is Total, always write additional context about what this total represents in this block!\n3. All additional info for context enrichment to make ensure complete context-independency if it present in whole table. This can include:\n    - The name of the table\n    - Additional footnotes\n    - The currency used\n    - The way amounts are presented\n    - Anything else that can make context even slightly richer\nSKIPPING ANY VALUABLE INFORMATION WILL BE HEAVILY PENALIZED!",
          "title": "Information Block",
          "type": "string"
        }
      },
      "required": [
        "subject_core_entity",
        "information_block"
      ],
      "title": "SerializedInformationBlock",
      "type": "object"
    }
  },
  "description": "Collection of serialized table blocks with their core entities and header relationships",
  "properties": {
    "subject_core_entities_list": {
      "description": "A complete list of core entities. Keep in mind, empty headers are possible - they should also be interpreted and listed (Usually it's a total or something similar). In most cases each row header represents a core entity",
      "items": {
        "type": "string"
      },
      "title": "Subject Core Entities List",
      "type": "array"
    },
    "relevant_headers_list": {
      "description": "A list of ALL headers relevant to the subject. These headers will serve as keys in each information block. In most cases each column header represents a core entity",
      "items": {
        "type": "string"
      },
      "title": "Relevant Headers List",
      "type": "array"
    },
    "information_blocks": {
      "description": "Complete list of fully described context-independent information blocks",
      "items": {
        "$ref": "#/$defs/SerializedInformationBlock"
      },
      "title": "Information Blocks",
      "type": "array"
    }
  },
  "required": [
    "subject_core_entities_list",
    "relevant_headers_list",
    "information_blocks"
  ],
  "title": "TableBlocksCollection",
  "type": "object"
}

